import React from "react";
import { useParams } from "react-router-dom";
import Input from "../../shared/components/FormElements/Input";
import Button from "../../shared/components/FormElements/Button";
import {
  VALIDATOR_REQUIRE,
  VALIDATOR_MINLENGTH,
} from "../../shared/util/validators";

const DUMMY_PLACES = [
  {
    id: "p1",
    title: "Brisbane Botanic Garden",
    description: "One of the most famous botanic garden in the Brisbane!",
    imageUrl:
      "https://images.pexels.com/photos/1322185/pexels-photo-1322185.jpeg?auto=compress&cs=tinysrgb&w=800",
    address: "152 Mount Coot-Tha Rd, Mount Coot-Tha QLD 4066",
    location: {
      lat: -27.4774246,
      lng: 152.9759935,
    },
    creator: "u1",
  },
  {
    id: "p2",
    title: "Brisbane Botanic Garden",
    description: "One of the most famous botanic garden in the Brisbane!",
    imageUrl:
      "https://images.pexels.com/photos/1322185/pexels-photo-1322185.jpeg?auto=compress&cs=tinysrgb&w=800",
    address: "152 Mount Coot-Tha Rd, Mount Coot-Tha QLD 4066",
    location: {
      lat: -27.4774246,
      lng: 152.9759935,
    },
    creator: "u2",
  },
];

const UpdatePlace = () => {
  const placeId = useParams().placeId;

  const identifiedPlace = DUMMY_PLACES.find((p) => p.id === placeId);

  if (!identifiedPlace) {
    return (
      <div className="center">
        <h2>Could not find place!</h2>
      </div>
    );
  }

  return (
    <form>
      <Input
        id="title"
        element="input"
        type="text"
        label="Title"
        validators={[VALIDATOR_REQUIRE()]}
      />
      <Button />
    </form>
  );
};

export default UpdatePlace;
